CREATE TABLE supplier ( supplier_id VARCHAR(10) PRIMARY KEY, name VARCHAR(255), contact_person VARCHAR(100), email VARCHAR(100), address VARCHAR(255));CREATE TABLE supplier_contact ( supplier_id VARCHAR(10), contact_no VARCHAR(20),  CONSTRAINT pk_suppliercontact PRIMARY KEY (supplier_id, contact_no), CONSTRAINT fk_supplier_contact_supplier FOREIGN KEY (supplier_id) REFERENCES supplier (supplier_id));CREATE TABLE physical_product ( product_id VARCHAR(10), type VARCHAR(255), name VARCHAR(255), description VARCHAR(255), unit_price DECIMAL(10, 2), available_stock INT, total_stock INT, supplier_id VARCHAR(10), size VARCHAR(50), weight DECIMAL(10, 2), color VARCHAR(50), CONSTRAINT pk_physicalproduct PRIMARY KEY (product_id, type), FOREIGN KEY (supplier_id) REFERENCES supplier(supplier_id));CREATE TABLE digital_product ( product_id VARCHAR(10), licenskey VARCHAR(255), name VARCHAR(255), description VARCHAR(255), unit_price DECIMAL(10, 2), available_stock INT, total_stock INT, supplier_id VARCHAR(10), CONSTRAINT pk_digitalproduct PRIMARY KEY (product_id, licenskey), FOREIGN KEY (supplier_id) REFERENCES supplier(supplier_id));CREATE TABLE customer ( customer_id VARCHAR(10) PRIMARY KEY, first_name VARCHAR(255), last_name VARCHAR(255), email VARCHAR(100), address VARCHAR(255));CREATE TABLE customer_contact ( customer_id VARCHAR(10), contact_no VARCHAR(20),  CONSTRAINT pk_cuscontact PRIMARY KEY (customer_id, contact_no), CONSTRAINT fk_customer_contact_customer FOREIGN KEY (customer_id) REFERENCES customer (customer_id));CREATE TABLE `order` ( order_id VARCHAR(10) PRIMARY KEY, `date` DATE, customer_id VARCHAR(10), total_amount DECIMAL(10, 2), status VARCHAR(20), FOREIGN KEY (customer_id) REFERENCES customer(customer_id));CREATE TABLE order_details ( order_detail_id VARCHAR(10) PRIMARY KEY, quantity INT, unit_price DECIMAL(10, 2), total_price DECIMAL(10, 2), FOREIGN KEY (order_id) REFERENCES `order`(order_id));CREATE TABLE physicalproduct_orderdetails ( order_detail_id VARCHAR(10), product_id VARCHAR(10), type VARCHAR(225),  CONSTRAINT pk_guest PRIMARY KEY (order_detail_id, product_id, type), FOREIGN KEY (type) REFERENCES physical_product (type), FOREIGN KEY (order_detail_id) REFERENCES order_details (order_detail_id), FOREIGN KEY (product_id) REFERENCES physical_product (product_id));CREATE TABLE digitalproduct_orderdetails ( order_detail_id VARCHAR(10), product_id VARCHAR(10), licenskey VARCHAR(225),   CONSTRAINT pk_guest PRIMARY KEY (order_detail_id, product_id, licenskey), FOREIGN KEY (licenskey) REFERENCES digital_product (licenskey), FOREIGN KEY (order_detail_id) REFERENCES order_details (order_detail_id), FOREIGN KEY (product_id) REFERENCES physical_product (product_id));INSERT INTO supplier (supplier_id, name, contact_person, email, address) VALUES ('Sup001', 'John Abrhum', 'John Doe', 'john.doe@gamil.com', '123 Main Street'),('Sup002', 'Nikesh Nithil', 'Jane Smith', 'jane.smith@gamil.com', '456 Elm Street'),('Sup003', 'Kamal Anirudh', 'Michael Johnson', 'michael.johnson@gamil.com', '789 Oak Street'),('Sup004', 'Patrick Jane', 'Emily Brown', 'emily.brown@gamil.com', '101 Pine Street'),('Sup005', 'Jane hightower', 'David Wilson', 'david.wilson@gamil.com', '202 Maple Street'),('Sup006', 'Brad Smith', 'Sarah Lee', 'sarah.lee@gamil.com', '303 Cedar Street'),('Sup007', 'Kevin Fernando', 'Kevin Miller', 'kevin.miller@gamil.com', '404 Birch Street'),('Sup008', 'Adam Martinez', 'Amanda Davis', 'amanda.davis@gamil.com', '505 Walnut Street'),('Sup009', 'Rebeca Silvester', 'Robert Taylor', 'robert.taylor@gamil.com', '606 Ash Street'),('Sup010', 'Anne Sebestian', 'Jessica Martinez', 'jessica.martinez@gamil.com', '707 Oakwood Avenue');INSERT INTO supplier_contact (supplier_id, contact_number)VALUES ('Sup001', '123-456-7890'),('Sup002', '234-567-8901'),('Sup003', '345-678-9012'),('Sup004', '456-789-0123'),('Sup005', '567-890-1234'),('Sup006', '678-901-2345'),('Sup007', '789-012-3456'),('Sup008', '890-123-4567'),('Sup009', '901-234-5678'),('Sup010